	}
}

function framLoad () {
	document.forms[0].AuthName.focus();
	var status = '0';
	var count = '';
	var Retry = '';
	var period = '';	
	var LockTime;
	var waitTime;
	if ( advancedaccountsecurity == '0' ) {
		loginrandom = '0';
	}
	
	if ( Retry != '' && parseInt(Retry) < 1262304000 ) {
		LockTime = timestampToDayStr ( parseInt(Retry) );
	} else if ( Retry != '' ) {
		LockTime = timestampToFullStr ( parseInt(Retry) );
	}

	if ( period != '' )
		waitTime = timestampToDayStr ( parseInt(period) );

	if ( status != '0' ) {
		if ( count == '0' ) {
			$("#Message").html("<font color='#DD0000'>This username is invalid currently.<br>Please retry after "+ LockTime +"</font>");
		}
		else if ( count == '' ) {
			if ( $.cookie("count") == null ) {
				$("#Message").html("<font color='#DD0000'>The username or password is not correct.</font>");
			}
			else {
				if ( $.cookie("Retry") == null ) {
					$("#Message").html("<font color='#DD0000'>You will be blocking for 15 mins after "+ $.cookie("count") +" failed login attempts.</font>");
				}
				else {
					if ( parseInt($.cookie("Left")) < 1262304000 ) {
						LockTime = timestampToDayStr ( parseInt($.cookie("Left")) );
					} else {
						LockTime = timestampToFullStr ( parseInt($.cookie("Left")) );
					}
					$("#Message").html("<font color='#DD0000'>You has been blocking.<br>Please retry after "+ LockTime +"</font>");
					$("#AuthName").attr("disabled", true);
					$("#Display").attr("disabled", true);
				}
			}
