			$("#Message").html("<font color='#DD0000'>The username or password is not correct.</font>");
		}
	}

	if ( loginrandom == '1' ) {
		$("#login").validate(
		{
			event: "keyup",
			rules:{
				AuthName:{required:true},
				Display:{
					required: {
						depends: function(element) {
