				Display:{required:true,maxlength:256}
			},
			messages: {
				AuthName: {
					required: "Username is required."
				},
				Display: {
					required: "Password is required.",
					maxlength: "The password is not correct."
				}
			}
	
		});
	}
}

</script>
</head>
